import axios from 'axios'


export const login = (data) => {
    return async (dispatch) => {
        try {
            const response = await axios.post(process.env.REACT_APP_URL_LOGIN,data)
            console.log(data)
            dispatch({
                type : 'USER_LOGIN',
                payload : response.data
            }) 
        }
        catch(error){
            error && alert(`login failed,${error.message}`)
        }
    }
}


export const logOut = () => {
    return {
        type : "USER_LOGOUT"
    }
}
